import supernovas from '../images/supernovas.png';
import '../styles/Roadmap.css';

function Roadmap() {
  return (

    <div className="Roadmap">
      <header className="Roadmap-header">
      <h1><br/>Roadmap</h1>
        <p className="Peque"><b style={{color: '#00fff2', maxWidth: "1000px"}}> Level 3.</b> <b style={{color: '#946cf2'}}>Generative Chum Collection:</b> Imagine Chum with a lot of traits and different hairstyles... or imagine a lot of infested rats with all those things... This last part will be put to a vote by all Chumpass holders, we will make the best generative NFT meme collection of all time.</p>
        <img src={supernovas} className="center" alt="Rats" style={{maxWidth: "1000px"}}/>
      </header><br/><br/><br/>
    </div>
  );
}

export default Roadmap;
